import Navigation from './componentes/Navegation'
import './App.css';

function App() {
  return (
    <div class="all">
      <section class="init">
        <Navigation />
      </section>
      <main class="content">
        <img src={fotoPerfil} alt="fotoPerfil" class="fotoPerfil"/>
      </main>
    </div>

  );
}

export default App;
